import React from "react";
import {
  StyledContainer,
  PageTitle,
  PageLogo,
  InnerContainer,
  SubTilte,
  StyledFormArea,

} from "./../Components/Styles";
import { StatusBar } from "expo-status-bar";
import {formik} from 'formik'

const Login = () => {
  return (
    <>
      <StyledContainer>
          <StatusBar>
          </StatusBar>
        <InnerContainer>
        <center>
        <PageLogo
            
            source={require("../../asset/chat.jpg")}
            alt="Studethandelr"
          />
          </center>
          <PageTitle>Students</PageTitle>
          <SubTilte>Account Login </SubTilte>
        <Formik
         intialValues={{email:" "}}
        >

        </Formik>
        </InnerContainer>
      </StyledContainer>
    </>
  );
};
export default Login;
